import React from 'react';

export default function Tile({ value, isNew }) {
  return (
    <div className={`tile${isNew ? ' new-tile' : ''}`} data-value={value}>
      <span className="tile-inner">{value > 0 ? value : ''}</span>
    </div>
  );
}
